import React from "react";
import { useDispatch } from "react-redux";
import { incrementCell } from "../../../../../../redux/actions";

const IncrementCell = React.forwardRef(
   ({ id, value, hoverCellHandler }, ref) => {
      const dispatch = useDispatch();

      return (
         <td
            ref={ref}
            onMouseEnter={() => hoverCellHandler(value)}
            onClick={() => dispatch(incrementCell(id, value))}
         >
            {value}
         </td>
      );
   }
);

export default IncrementCell;
